const userData=localStorage.getItem("userId"),userId=JSON.parse(userData);fetch(`/auth/getMyList/${userId.userId}`).then(a=>a.json()).then(a=>{const e=document.getElementById("action_bx");a.forEach(a=>{(a=>{const{picture:n,title:t,year:s,url:r,rate:c}=a,d=document.createElement("div");d.classList.add("card"),d.innerHTML=`\n      <a href="/player?url=${encodeURIComponent(r)}"> \x3c!-- Add the URL as a query parameter --\x3e  \n      <div>\n        <img src="${n}" alt="${t}">\n      </div>\n    </a>\n      <div class="content">\n        <h2>${t}</h2>\n        <div class="metadata">\n            <span>${s}</span>\n            <div class="rate">\n              <i class="fas fa-heart"></i>\n              <i class="fas fa-eye"></i>\n              <i class="fas fa-star"></i>\n              <span>${c}</span>\n            </div>\n        </div>\n      </div>\n    `,e.appendChild(d)})(a)})}).catch(a=>{console.log("Error fetching data from the server:",a)});